$_['When the store is not available network outage server failure or any other outage when the feedback of Stripe is sent then the transaction state is not updated Hence no order confirmation email is sent and the order is not in the paid state By activating the transaction update such transactions can be authorized later over direct link To use this feature the update service must be activated and the API username and the API password must be set'] = "Cuando la tienda no está disponible (interrupción de la red, falla en el servidor o cualquier otra interrupción), cuando se envía el votaciones de Stripe, entonces el estado de la transacción no se actualiza. De ahí que no se envía ninguna confirmación del pedido por e-mail y la orden no se encuentra en estado de pago. Mediante la activación de la actualización de la transacción, tales transacciones pueden ser autorizados posteriormente a través del enlace directo. Para utilizar esta función, el servicio de actualización debe estar activado y el nombre de usuario y la contraseña de API se debe establecer.";
